var bundesliga=new Liga(bl1_teams);

function Liga(ligateams) {
	this.teams=[];
	this.matchdata=[];
	this.active_matchday=false;
	this.last_update=false;
	ligateams.forEach((t)=>{this.teams.push(new Team(t.TeamId,t.TeamName,t.ShortName))});
}

Liga.prototype.get_team_by_searchstring = function (s) {
	var res;
	this.teams.forEach((t)=>{
		if ((t.TeamId==s)||(t.TeamName==s)||(t.ShortName==s)) {res=t}
	})
	return res;
}

Liga.prototype.update = function(matchdatapath,callback) {
	this.teams.forEach((t)=>{t.init()});
	this.matchdata=[];
	this.last_update=false;
	get_matchdata(matchdatapath,(m)=>{

		m.forEach((m)=>{
			if (m.MatchIsFinished && m.hasOwnProperty('MatchResults') && m.Team1.TeamId>=0 && m.Team2.TeamId>=0) {
				if (m.MatchResults.length>0) {
				  var team1=this.get_team_by_searchstring(m.Team1.TeamId);
				  var team2=this.get_team_by_searchstring(m.Team2.TeamId);
				  team1.goals_shot+=m.MatchResults[1].PointsTeam1;
				  team1.goals_got+=m.MatchResults[1].PointsTeam2;
				  team2.goals_shot+=m.MatchResults[1].PointsTeam2;
				  team2.goals_got+=m.MatchResults[1].PointsTeam1;
				  if (m.MatchResults[1].PointsTeam1>m.MatchResults[1].PointsTeam2) {team1.won++; team2.lost++}
				  else if (m.MatchResults[1].PointsTeam1<m.MatchResults[1].PointsTeam2) {team1.lost++; team2.won++}
				  else {team1.draw++; team2.draw++}
				  if (!this.active_matchday||this.active_matchday<m.Group.GroupOrderID) {this.active_matchday=m.Group.GroupOrderID}
			  };
			}
		  if (!this.last_update||this.last_update<m.LastUpdateDateTime) {this.last_update=m.LastUpdateDateTime}
	  this.matchdata.push({
			"MatchDay":m.Group.GroupOrderID,
			"MatchDateTime":m.MatchDateTime,
			"Team1":m.Team1.TeamId,
			"Team2":m.Team2.TeamId,
			"MatchIsFinished":m.MatchIsFinished,
			"MatchResults":m.MatchResults
	  });
		});     

		this.teams.sort((a,b)=>this.liga_order(a,b));
		//this.matchdata.sort((a,b)=>{if (a.MatchDateTime<b.MatchDateTime){return 1} else if (a.MatchDateTime<b.MatchDateTime){return -1} else {return 0}});
		callback();
	
	});
}

function Team(TeamId,TeamName,ShortName) {
	this.TeamId=TeamId;
	this.TeamName=TeamName;
	this.ShortName=ShortName;
}

Team.prototype.init = function () {
	this.won=0;
	this.draw=0;
	this.lost=0;
	this.goals_shot=0;  
	this.goals_got=0;
}

Liga.prototype.liga_order = function(a,b) {
	// 1. score
	var a_score=a.won*3+a.draw, b_score=b.won*3+b.draw;
	if ( a_score < b_score ) {return 1} else if ( a_score > b_score ) {return -1}
  // 2. goals sum
	var a_goals=a.goals_shot-a.goals_got, b_goals=b.goals_shot-b.goals_got;
	if ( a_goals < b_goals ) {return 1} else    if ( a_goals > b_goals ) {return -1}
  // 3. goals more
	if ( a.goals_shot < b.goals_shot ) {return 1} else if ( a.goals_shot > b.goals_shot ) {return -1}
	return 0;
}

Liga.prototype.get_liga_table = function () {
	var out='', position=0, last_update=false;
	while (position<this.teams.length) {
		position++;
		var t=this.teams[position-1];
		if ( (position==1) || (this.liga_order(t,this.teams[position-2])!=0) ) {out+=z2h(position)} else {out+='  '};
		out+=' '+z10t(t.TeamName)+' '+z2h(t.won+t.draw+t.lost)+' '+z2h(t.goals_shot)+':'+z2t(t.goals_got)+' '+z3h(t.goals_shot-t.goals_got)+' '+z2h(t.won*3+t.draw)+'\n';
	}
	return out;
}
function z2h(string) {return string.toString().length>=2?string:' '+string}
function z3h(string) {while (string.toString().length<3) {string=' '+string}; return string}
function z2t(string) {return string.toString().length>=2?string:string+' '}
function z10t(string) {while (string.toString().length<10) {string+=' '}; return string}

Liga.prototype.get_current_matches = function () {
	var out=this.active_matchday+'. Spieltag\n';
	var out_next=(this.active_matchday+1)+'. Spieltag\n';
	this.matchdata.forEach((m)=>{
		if (m.MatchDay==this.active_matchday) {
			out+=z10t(this.get_team_by_searchstring(m.Team1).TeamName)+' '+z10t(this.get_team_by_searchstring(m.Team2).TeamName)+' ';
		  if (m.MatchIsFinished) {out+=m.MatchResults[1].PointsTeam1+':'+m.MatchResults[1].PointsTeam2} 
		  else {
				var d=new Date(m.MatchDateTime+'+02:00');
			  out+=['SO','MO','DI','MI','DO','FR','SA'][d.getDay()]+' '+m.MatchDateTime.substring(11,16)
		  }
		  out+='\n';
		}
		else if (m.MatchDay==(this.active_matchday+1)) {
			out_next+=z10t(this.get_team_by_searchstring(m.Team1).TeamName)+' '+z10t(this.get_team_by_searchstring(m.Team2).TeamName)+' ';
		  if (m.MatchIsFinished) {out_next+=m.MatchResults[1].PointsTeam1+':'+m.MatchResults[1].PointsTeam2}
		  else {
				var d=new Date(m.MatchDateTime+'+02:00');
			  out_next+=['SO','MO','DI','MI','DO','FR','SA'][d.getDay()]+' '+m.MatchDateTime.substring(11,16)
		  }
		  out_next+='\n';
		}
	});
	return out+'\n'+out_next;
}

function get_matchdata(matchdatapath,callback) {
	require('https').get({host:'www.openligadb.de', path:matchdatapath}, function(r) {
		var res=""; 
		r.on('data', function(d) {res+=d}); 
		r.on('end', function() { 
			callback(JSON.parse(res));
		});
	}).on('error',(e)=>{console.log(e)})
}

